const Bars=()=>{
	return(
        <div>
            <div class="navbar navbar1">
                <div class="navbar_left">
                    
                    <ul  class="menu">
                        <li class="li_img"><img src="./2121.jpg" alt="PDP" width="100%" class="img_pers" /></li>
                        <li>
                            <div class="dropdown">
                              <button class="dropbtn"> &or; </button>
                                  <div class="dropdown-content">
                                    <a href="#">Link 1</a>
                                    <a href="#">Link 2</a>
                                    <a href="#">Link 3</a>
                                  </div>
                            </div>
                        </li>

                    </ul>
                </div>
                <span style={{fontSize:'30px',cursor:'pointer',color: '#505978'}} onclick={openNav()}>&#9776;</span>
            </div>
        


            <div id="mySidenav" class="sidenav" style={{width:'0'}}>
                <a href='#' class="closebtn" onclick={closeNav()}>&times;</a>
                <a href='#'>Home</a>
                <a href='#'>Creer un covoiturage</a>
                <a href='#'>Mes Messages</a>
                <a href='#'>Contact</a>
                <div class="navbar_right">
                    <ul>
                        <li><a href='#'>Sign Out</a> </li>
                    </ul>

                </div>
            </div>
            </div>
		);

}
const openNav=() => {
  document.getElementById("mySidenav").style.width = "350px";
  document.getElementById("mySidenav").style.marginTop = "60px";

}

const closeNav=() => {
  document.getElementById("mySidenav").style.width = "0";

}

export default Bars;
